                            کامیونت جک ۸.۵ تن، محصول تولیدی خودروسازی چین می باشد که در ایران توسط شرکت آرین دیزل مونتاژ و عرضه می شود. این خودرو به دلیل داشتن موتور قدرتمند همواره انتخاب خوبی برای جابه جایی بارهای سنگین درون شهری می باشد. این کامیونت به دلیل کیفیت بالای قطعات و بازدهی مناسب توانسته است بازار کشور را در دست بگیرد.
