                            <p class="c-products__info-desc">
                            کامیونت جک ۹ تن، محصولی دیگر از کمپانی چینی تبار جک موتورز است که همچون سایر محصولات این شرکت توسط شرکت خودروسازی آرین دیزل در ایران مونتاژ و عرضه می‌گردد. کامیونت ۹ تن این کمپانی با برخورداری از موتوری پرقدرت به حجم ۳۷۶۰ سی سی و توان بالا در جا به جایی بارهایی با تناژ بالا بهترین و مناسب ترین گزینه است.
